    <div className="bg-[#ccfbf1] w-full py-[100px] text-center">
      <div className=" max-w-[1240px] py-[100px] mx-auto text-center font-bold">
        <div className="text-xl md:text-3xl font-bold md:p-[24px]">Learn with Us.</div>

        <h2 className="text-[#0f172a]  text-3xl  md:text-[50px] md:p-[24px]">
          Grow with Us.
        </h2>

        <div className=" text-[10px] md:text-[50px] md:p-[24px] text-black">
                  <Typed strings={[' Software Development.!!','Freelancer with MERN And Other Technologies..!!','Tuition Class with MERN Technology']} typeSpeed={90} />
        </div>
      </div>
    </div>
  );
}
